import React from 'react'
// import { useEffect } from 'react'
// import { getAllTopicMessages } from '../utilities/forum-services'
// import { useState } from 'react'

function Topic({title, topic_id, timestamp, history}) {
    let timeStamp = new Date (timestamp).toLocaleString()

    return (

            <li onClick={() => history.push(`/topic-list/${topic_id}`)}>{title} {timeStamp}</li>

    )
}

export default Topic
